import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [fizzBuzzList, setFizzBuzzList] = useState([]);

  useEffect(() => {
    fetch('/api/fizzbuzz')
      .then(response => response.json())
      .then(data => setFizzBuzzList(data));
  }, []);

  return (
    <div className="App">
      <h1>FizzBuzz</h1>
      <ul>
        {fizzBuzzList.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
